      // visualization to make sure not to delete handlers for other profvis
      // visualizations on the same page (this can happen with Rmd documents).
      $(window).off("resize.profvis." + resizeCallbackNamespace);
      $(window).on("resize.profvis." + resizeCallbackNamespace, resizePanelsDebounced);

      // Get current proportional position of split bar
      function splitProportion() {
        var splitCenter;

        if (vis.splitDir === "v") {
          splitCenter = $splitBar.offset().left - $panel1.offset().left +
                            $splitBar.outerWidth()/2;
          var innerWidth = offsetRight($panel2) - $panel1.offset().left;
          return splitCenter / innerWidth;

        } else if (vis.splitDir === "h") {
          splitCenter = $splitBar.offset().top - $panel1.offset().top +
                            $splitBar.outerHeight()/2;
          var innerHeight = offsetBottom($panel2) - $panel1.offset().top;
          return splitCenter / innerHeight;
        }
      }

      function positionRight($el) {
        return $el.position().left + $el.outerWidth();
      }
      function offsetRight($el) {
        return $el.offset().left + $el.outerWidth();
      }
      function positionBottom($el) {
        return $el.position().top + $el.outerHeight();
      }
      function offsetBottom($el) {
        return $el.offset().top + $el.outerHeight();
      }

      // Enable dragging of the split bar ---------------------------------------
      (function() {
        var dragging = false;
        // For vertical split (left-right dragging)
        var startDragX;
        var startOffsetLeft;
        // For horizontal split (up-down dragging)
        var startDragY;
        var startOffsetTop;

        var stopDrag = function(e) {
          if (!dragging) return;
          dragging = false;

          document.removeEventListener("mousemove", drag);
          document.removeEventListener("mouseup", stopDrag);

          $splitBar.css("opacity", "");

          if ((vis.splitDir === "v" && e.pageX - startDragX === 0) ||
              (vis.splitDir === "h" && e.pageY - startDragY === 0)) {
            return;
          }

          resizePanels(splitProportion());
          vis.flameGraph.onResize();
        };

        var startDrag = function(e) {
          // Don't start another drag if we're already in one.
          if (dragging) return;
          dragging = true;
          pauseEvent(e);

          $splitBar.css("opacity", 0.75);

          if (vis.splitDir === "v") {
            startDragX = e.pageX;
            startOffsetLeft = $splitBar.offset().left;
          } else {
            startDragY = e.pageY;
            startOffsetTop = $splitBar.offset().top;
          }

          document.addEventListener("mousemove", drag);
          document.addEventListener("mouseup", stopDrag);
        };

        var drag = function(e) {
          if (!dragging) return;
          pauseEvent(e);

          if (vis.splitDir === "v") {
            var dx = e.pageX - startDragX;
            if (dx === 0)
              return;

            // Move the split bar
            $splitBar.offset({ left: startOffsetLeft + dx });

          } else if (vis.splitDir === "h") {
            var dy = e.pageY - startDragY;
            if (dy === 0)
              return;

            // Move the split bar
            $splitBar.offset({ top: startOffsetTop + dy });
          }
        };

        // Stop propogation so that we don't select text while dragging
        function pauseEvent(e){
          if(e.stopPropagation) e.stopPropagation();
          if(e.preventDefault) e.preventDefault();
          e.cancelBubble = true;
          e.returnValue = false;
          return false;
        }

        // Remove existing event listener from previous calls to initResizing().
        $splitBar.off("mousedown.profvis");
        $splitBar.on("mousedown.profvis", startDrag);
      })();


      return {
        resizePanels: resizePanels
      };
    }


    var prof = prepareProfData(message.prof, message.interval);

    var vis = {
      el: el,
      prof: prof,
      profTree: getProfTree(prof),
      interval: message.interval,
      totalTime: getTotalTime(prof),
      totalMem: getTotalMemory(prof),
      files: message.files,
      aggLabelTimes: getAggregatedLabelTimes(prof),
      fileLineStats: getFileLineStats(prof, message.files),
      profTable: [],

      // Objects representing each component
      statusBar: null,
      optionsPanel: null,
      codeTable: null,
      flameGraph: null,
      infoBox: null,
      treetable: null,
      activeViews: [],

      // Functions to enable/disable responding to scrollwheel events
      enableScroll: enableScroll,
      disableScroll: disableScroll,

      splitDir: message.split,

      hideMemory: false,

    var panel1 = document.createElement("div");

    var panel2 = document.createElement("div");
    panel2.className = "profvis-panel2";
    vis.el.appendChild(panel2);

    var splitBarEl = document.createElement("div");
    splitBarEl.className = "profvis-splitbar";
    vis.el.appendChild(splitBarEl);

  // Calculate amount of time spent on each line of code. Returns nested objects
  // grouped by file, and then by line number.
  function getFileLineStats(prof, files) {
    // Drop entries with null or "" filename
    prof = prof.filter(function(row) {
      return row.filename !== null && row.filename !== "";
    });

    // Gather line-by-line file contents
    var fileLineStats = files.map(function(file) {
      // Create array of objects with info for each line of code.
      var lines = file.content.split("\n");
      var lineData = [];
      var filename = file.filename;
      var normpath = file.normpath;
      for (var i=0; i<lines.length; i++) {
        lineData[i] = {
          filename: filename,
          normpath: normpath,
          linenum: i + 1,
          content: lines[i],
          sumTime: 0,
          sumMem: 0,
          sumMemAlloc: 0,
          sumMemDealloc: 0
        };
      }

      return {
        filename: filename,
        lineData: lineData
      };
    });

    // Get timing data for each line
    var statsData = d3.nest()
      .key(function(d) { return d.filename; })
      .key(function(d) { return d.linenum; })
      .rollup(function(leaves) {
        var sumTime = leaves.reduce(function(sum, d) {
          // Add this node's time only if no ancestor node has the same
          // filename and linenum. This is to avoid double-counting times for
          // a line.
          var incTime = 0;
          if (!ancestorHasFilenameLinenum(d.filename, d.linenum, d.parent)) {
            incTime = d.endTime - d.startTime;
          }
          return sum + incTime;
        }, 0);

        var sumMem = leaves.reduce(function(sum, d) {
          return sum + d.sumMem;
        }, 0);

        var sumMemDealloc = leaves.reduce(function(sum, d) {
          return sum + d.sumMemDealloc;
        }, 0);

        var sumMemAlloc = leaves.reduce(function(sum, d) {
          return sum + d.sumMemAlloc;
        }, 0);

        return {
          filename: leaves[0].filename,
          linenum: leaves[0].linenum,
          sumTime: sumTime,
          sumMem: sumMem,
          sumMemAlloc: sumMemAlloc,
          sumMemDealloc: sumMemDealloc
        };
      })
      .entries(prof);

    // Insert the sumTimes into line content data
    statsData.forEach(function(fileInfo) {
      // Find item in fileTimes that matches the file of this fileInfo object
      var fileLineData = fileLineStats.filter(function(d) {
        return d.filename === fileInfo.key;
      })[0].lineData;

      fileInfo.values.forEach(function(lineInfo) {
        lineInfo = lineInfo.values;
        fileLineData[lineInfo.linenum - 1].sumTime = lineInfo.sumTime;
        fileLineData[lineInfo.linenum - 1].sumMem = lineInfo.sumMem;
        fileLineData[lineInfo.linenum - 1].sumMemDealloc = lineInfo.sumMemDealloc;
        fileLineData[lineInfo.linenum - 1].sumMemAlloc = lineInfo.sumMemAlloc;
      });
    });

    // Calculate proportional times, relative to the longest time in the data
    // set. Modifies data in place.
    var fileMaxTimes = fileLineStats.map(function(lines) {
      var lineTimes = lines.lineData.map(function(x) { return x.sumTime; });
      return d3.max(lineTimes);
    });

    var maxTime = d3.max(fileMaxTimes);

    fileLineStats.map(function(lines) {
      lines.lineData.map(function(line) {
        line.propTime = line.sumTime / maxTime;
      });
    });

    var totalMem = getTotalMemory(prof);

    fileLineStats.map(function(lines) {
      lines.lineData.map(function(line) {
        line.propMem = line.sumMem / totalMem;
        line.propMemDealloc = line.sumMemDealloc / totalMem;
        line.propMemAlloc = line.sumMemAlloc / totalMem;
      });

it_len = lvfll,\n    debug_output = FALSE\n  )\n})\n","normpath":"<expr>"},{"filename":"PANPRSnext/R/PANPRS.R","content":"#' Run the package on the provided data set\n#' @export\ntest_pkg <- function(\n  debug_output = FALSE\n) {\n  data(\"summaryZ\")\n  data(\"Nvec\")\n  data(\"plinkLD\")\n  data(\"funcIndex\")\n  output <- gsfPEN_R(\n    summary_z = summaryZ, # nolint: object_usage_linter.\n    n_vec = Nvec, # nolint: object_usage_linter.\n    plinkLD = plinkLD, # nolint: object_usage_linter.\n    func_index = funcIndex, # nolint: object_usage_linter.\n    debug_output = debug_output\n  )\n\n  return(output)\n}\n\n#' Run the package on the provided data set\n#' DEBUG VERSION\n#' @export\ndebug_test_pkg <- function(\n  summaryZ,\n  funcIndex,\n  debug_output = FALSE,\n  sub_tuning = 1,\n  lambda_vec_limit_len = c(1.5, 1)\n) {\n  data(\"summaryZ\")\n  data(\"Nvec\")\n  data(\"plinkLD\")\n  data(\"funcIndex\")\n  output <- gsfPEN_R(\n    summary_z = summaryZ, # nolint: object_usage_linter.\n    n_vec = Nvec, # nolint: object_usage_linter.\n    plinkLD = plinkLD, # nolint: object_usage_linter.\n    func_index = funcIndex, # nolint: object_usage_linter.\n    sub_tuning = sub_tuning,\n    lambda_vec_limit_len = lambda_vec_limit_len,\n    debug_output = debug_output\n  )\n\n  return(output)\n}\n\n#' Main Function\n#' @export\ngsfPEN_R <- function(\n    summary_z,\n    n_vec,\n    plinkLD,\n    func_index,\n    n_iter = 1000,\n    upper_val = NULL,\n    breaking = 1,\n    z_scale = 1,\n    tuning_matrix = NULL,\n    p_threshold = NULL,\n    p_threshold_params = c(0.5, 10^-4, 4),\n    tau_factor = c(1 / 25, 1, 3),\n    len_lim_lambda = 4,\n    sub_tuning = 4,\n    lim_lambda = c(0.5, 0.9),\n    len_lambda = 4,\n    lambda_vec = NULL,\n    lambda_vec_limit_len = c(1.5, 3),\n    df_max = NULL,\n    debug_output = FALSE\n) {\n  time <- proc.time()\n\n  if (z_scale != 1) {\n    error(\"Tuning values set-up for multiple traits analysis requires z_scale=1.\") # nolint: object_usage_linter.\n  }\n\n  num_func <- ncol(func_index)\n\n  P <- nrow(summary_z)\n  Q <- length(n_vec)\n\n  summary_betas <- matrix(0, nrow = P, ncol = Q)\n  SD_vec <- matrix(0, nrow = P, ncol = Q)\n\n  for (ii in 1:Q) {\n    summary_betas[, ii] <- summary_z[, ii] / sqrt(n_vec[ii])\n    SD_vec[, ii] <- 1 / sqrt(n_vec[ii])\n  }\n\n  rownames(summary_betas) <- rownames(summary_z)\n\n  if (is.null(df_max)) {\n    df_max <- ceiling(0.7 * P)\n  }\n\n  if (is.null(p_threshold)) {\n    p_threshold <- seq(p_threshold_params[1], p_threshold_params[2], length.out = p_threshold_params[3])\n  }\n\n  if (any(c(is.null(tuning_matrix), is.null(lambda_vec)))) {\n    median_val <- median(apply(abs(summary_betas), 1, sum), na.rm = TRUE)\n    tau_vec <- sort(median_val * tau_factor)\n    lim_lambda <- quantile(abs(summary_z[, 1]), lim_lambda)\n\n    output <- Tuning_setup_group_func(\n      lambda_vec,\n      lambda_vec_limit_len,\n      p_threshold,\n      num_func,\n      tau_vec,\n      sub_tuning,\n      lim_lambda,\n      len_lambda,\n      len_lim_lambda,\n      median_val\n    )\n\n    func_lambda <- output$func_lambda\n    lambda_vec <- output$lambda_vec\n    tuning_matrix <- output$tuning_matrix\n\n    rm(output)\n  } else {\n    func_lambda <- permutations( # nolint: object_usage_linter.\n      length(lambda_vec),\n      num_func,\n      repeats.allowed = TRUE\n    ) - 1\n  }\n\n  beta_index <- c(seq_len(nrow(summary_betas))) - 1\n  SNP_names <- rownames(summary_betas)\n\n  # Takes only the SNPs that are present in both the PLINK data set and the GWAs\n  ld_J <- PlinkLD_transform(plinkLD, SNP_names)\n\n  J_id_matrix <- matrix(nrow = nrow(ld_J), ncol = 2)\n\n  mat1 <- match(ld_J[, 1], SNP_names)\n  mat2 <- match(ld_J[, 2], SNP_names)\n\n  J_id_matrix[, 1] <- beta_index[mat1]\n  J_id_matrix[, 2] <- beta_index[mat2]\n\n  ld_J[, 1] <- J_id_matrix[, 1]\n  ld_J[, 2] <- J_id_matrix[, 2]\n\n  od <- order(J_id_matrix[, 1], J_id_matrix[, 2], decreasing = FALSE)\n  ld_J <- ld_J[od, ]\n\n\n  wind <- which(!beta_index %in% ld_J[, 1])\n  num_indices <- length(wind)\n\n  index_J <- -1\n  if (num_indices > 0) {\n    index_J <- beta_index[wind]\n  }\n\n  counts <- table(ld_J[, 1])\n  num_SNP <- length(counts)\n\n  index_S <- c(0, cumsum(counts)[-num_SNP])\n  index_E <- cumsum(counts) - 1\n\n  index_matrix <- matrix(nrow = num_SNP, ncol = 3)\n  index_matrix[, 1] <- as.numeric(names(counts))\n\n  index_matrix[, 2] <- index_S\n  index_matrix[, 3] <- index_E\n\n  ld_vec <- ld_J[, 3]\n  ld_J <- ld_J[, 2]\n\n\n  if (is.null(upper_val)) {\n    upper_val <- ceiling(max(abs(summary_betas), na.rm = TRUE) * 50)\n  }\n\n  if (nrow(func_index) != nrow(summary_betas)) {\n    stop(\"nrow of summary_betas and row of func_index do not match.\")\n  }\n\n\n  z_matrix <- as.matrix(1 - func_index)\n  # z_matrix <- matrix(1 - unlist(func_index), nrow = nrow(func_index), ncol = ncol(func_index), byrow = TRUE)\n  # rownames(z_matrix) <- rownames(func_index)\n\n  sum_func_index <- apply(z_matrix, 1, sum)\n  Ifunc_SNP <- rep(0, P)\n  Ifunc_SNP[which(sum_func_index != 0)] <- 1\n\n  lambda0_vec <- abs(-qnorm(p_threshold / 2))\n\n  nrow_index_matrix <- nrow(index_matrix)\n  ncol_index_matrix <- ncol(index_matrix)\n\n  nrow_z_matrix <- nrow(z_matrix)\n  ncol_z_matrix <- ncol(z_matrix)\n\n  nrow_func_lambda <- nrow(func_lambda)\n  ncol_func_lambda <- ncol(func_lambda)\n\n  nrow_tuning_matrix <- nrow(tuning_matrix)\n  ncol_tuning_matrix <- ncol(tuning_matrix)\n\n  nrow_all_tuning_matrix <- nrow_tuning_matrix * length(p_threshold) * nrow_func_lambda\n  ncol_all_tuning_matrix <- (num_func + 1) + 2\n\n  nrow_beta_matrix <- nrow_all_tuning_matrix\n  ncol_beta_matrix <- P * Q\n\n  dims <- c(\n    num_SNP,                # 1\n    P,                      # 2\n    Q,                      # 3\n    nrow_index_matrix,      # 4\n    ncol_index_matrix,      # 5\n    nrow_z_matrix,          # 6\n    ncol_z_matrix,          # 7\n    nrow_func_lambda,       # 8\n    ncol_func_lambda,       # 9\n    nrow_tuning_matrix,     # 10\n    ncol_tuning_matrix,     # 11\n    nrow_all_tuning_matrix, # 12 == num_tuning\n    ncol_all_tuning_matrix, # 13\n    nrow_beta_matrix,       # 14\n    ncol_beta_matrix        # 15\n  )\n\n  params <- c(\n    upper_val,              # 1\n    n_iter,                 # 2\n    breaking,               # 3\n    z_scale,                # 4\n    df_max,                 # 5\n    length(p_threshold),    # 6\n    num_indices             # 7\n  )\n\n\n  print(paste0(\"Number of total tuning combinations = \", nrow_all_tuning_matrix))\n\n  Z <- gsfPEN_cpp(\n    summary_betas,\n    ld_J,\n    index_matrix,\n    index_J,\n    ld_vec,\n    SD_vec,\n    tuning_matrix,\n    lambda0_vec,\n    z_matrix,\n    lambda_vec,\n    func_lambda,\n    Ifunc_SNP,\n    dims,\n    params\n  )\n\n  beta_matrix <- Z$beta_matrix\n  colnames(beta_matrix) <- paste0(\n    rep(SNP_names, times = Q),\n    \".trait\",\n    rep(c(1:Q), each = P)\n  )\n\n  all_tuning_matrix <- Z$all_tuning_matrix\n  colnames(all_tuning_matrix) <- c(\n    \"lambda0\",\n    paste0(\"lambdaf\", c(1:num_func)),\n    \"lamda2\",\n    \"tau2\"\n  )\n\n  num_iter_vec <- Z$num_iter_vec\n\n  # Remove the tuning combinations that did not converge (correspons to -2 in num_iter_vec)\n  if (!debug_output) {\n    print(\"Removing tuning combinations that did not converge.\")\n    converge_index <- which(num_iter_vec > 0)\n    num_iter_vec <- num_iter_vec[converge_index]\n    beta_matrix <- beta_matrix[converge_index, ]\n    all_tuning_matrix <- all_tuning_matrix[converge_index, ]\n  }\n\n  output <- Clean_results(\n    beta_matrix = beta_matrix,\n    num_iter_vec = num_iter_vec,\n    all_tuning_matrix = all_tuning_matrix\n  )\n\n  time <- proc.time() - time\n  print(paste0(\"Time elapsed: \", time[3], \" seconds\"))\n\n  return(output)\n}","normpath":"/home/jared/Desktop/PANPRS-next-Katya/PANPRSnext/R/PANPRS.R"},{"filename":"PANPRSnext/R/PlinkLD_transform.R","content":"PlinkLD_transform <- function(plinkLD, all_keep_snps) {\n    wkeep <- which(plinkLD$SNP_A %in% all_keep_snps & plinkLD$SNP_B %in% all_keep_snps)\n    plinkLD <- plinkLD[wkeep, ]\n\n    if (length(which(is.na(plinkLD))) > 0) {\n        stop(\"\")\n    }\n\n    ld_J <- plinkLD[, c(\"SNP_B\", \"SNP_A\", \"R\")]\n    names(ld_J) <- c(\"SNP_A\", \"SNP_B\", \"R\")\n\n    ld_J <- rbind(plinkLD[, c(\"SNP_A\", \"SNP_B\", \"R\")], ld_J)\n\n    return(ld_J)\n}","normpath":"/home/jared/Desktop/PANPRS-next-Katya/PANPRSnext/R/PlinkLD_transform.R"},{"filename":"PANPRSnext/R/RcppExports.R","content":"# Generated by using Rcpp::compileAttributes() -> do not edit by hand\n# Generator token: 10BE3573-1514-4C36-9D1C-5A225CD40393\n\n#' Main CPP function\n#' @param summary_betas matrix of summary statistics\n#' @param ld_J vector of indices of SNPs in LD with the current SNP\n#' @param index_matrix matrix of indices of SNPs in LD with the current SNP\n#' @param index_J vector of indices of SNPs in LD with the current SNP\n#' @param ld_vec vector of LD values\n#' @param SD_vec matrix of SD values\n#' @param tuning_matrix matrix of tuning parameters\n#' @param lambda0_vec vector of lambda0 values\n#' @param z_matrix matrix of z values\n#' @param lambda_vec_func vector of lambda values\n#' @param func_lambda matrix of lambda values\n#' @param Ifunc_SNP vector of indices of SNPs in LD with the current SNP\n#' @param dims vector of dimensions\n#' @param params vector of parameters\ngsfPEN_cpp <- function(summary_betas, ld_J, index_matrix, index_J, ld_vec, SD_vec, tuning_matrix, lambda0_vec, z_matrix, lambda_vec_func, func_lambda, Ifunc_SNP, dims, params) {\n    .Call(`_PANPRSnext_gsfPEN_cpp`, summary_betas, ld_J, index_matrix, index_J, ld_vec, SD_vec, tuning_matrix, lambda0_vec, z_matrix, lambda_vec_func, func_lambda, Ifunc_SNP, dims, params)\n}\n","normpath":"/home/jared/Desktop/PANPRS-next-Katya/PANPRSnext/R/RcppExports.R"},{"filename":"PANPRSnext/R/Internal_functions.R","content":"Tuning_setup_group_only <- function(\n    tau_vec,\n    sub_tuning,\n    lim_lambda,\n    len_lambda,\n    len_lim_lambda,\n    median_val\n) {\n  lambda_vec <- seq(min(lim_lambda), max(lim_lambda), len = len_lambda)\n  tuning_matrix <- cbind(lambda_vec, 1, 0, 1)\n\n  top_vec <- seq(min(lim_lambda), max(lim_lambda), len = len_lim_lambda)\n\n  for (i in seq_along(tau_vec)) {\n      tau <- tau_vec[i]\n\n      for (t in 2:length(top_vec)) {\n          top <- top_vec[t]\n          lambda_vec <- seq(min(lim_lambda), (top - 0.05), len = sub_tuning)\n\n          temp <- (top - lambda_vec) * (median_val + tau)\n          tuning_matrix <- rbind(tuning_matrix, cbind(lambda_vec, tau, temp, tau))\n      }\n  }\n  return(tuning_matrix)\n}\n\nTuning_setup_group_func <- function(\n    lambda_vec,\n    lambda_vec_limit_len,\n    p_threshold,\n    num_func,\n    tau_vec,\n    sub_tuning,\n    lim_lambda,\n    len_lambda,\n    len_lim_lambda,\n    median_val\n) {\n  lim_lambda_vec <- seq(min(lim_lambda), max(lim_lambda), len = len_lambda)\n\n  top_vec <- seq(min(lim_lambda), max(lim_lambda), len = len_lim_lambda)\n\n  start <- 1\n  for (i in seq_along(tau_vec)) {\n      tau <- tau_vec[i]\n\n      for (t in 2:length(top_vec)) {\n          top <- top_vec[t]\n          lim_lambda_vec <- seq(min(lim_lambda), (top - 0.05), len = sub_tuning)\n\n          temp <- (top - lim_lambda_vec) * (median_val + tau)\n          if (start == 1) {\n              tuning_matrix <- cbind(lim_lambda_vec, tau, temp, tau)\n              start <- 0\n          } else {\n              tuning_matrix <- rbind(tuning_matrix, cbind(lim_lambda_vec, tau, temp, tau))\n          }\n      }\n  }\n\n  if (is.null(lambda_vec)) {\n      lambda_vec <- seq(0, lambda_vec_limit_len[1], length.out = lambda_vec_limit_len[2])\n  }\n\n  func_lambda <- permutations( # nolint: object_usage_linter.\n    length(lambda_vec),\n    num_func,\n    repeats.allowed = TRUE\n  ) - 1\n\n  output <- list(\n    func_lambda = func_lambda,\n    lambda_vec = lambda_vec,\n    tuning_matrix = tuning_matrix\n  )\n\n  return(output)\n}\n\nNon_zero <- function(xx) {\n  return(length(which(xx != 0)))\n}\n\nClean_results <- function(\n    beta_matrix,\n    num_iter_vec,\n    all_tuning_matrix\n) {\n  # Selects only the unique rows, corresponding to unique tuning parameters\n  tuning_vec <- apply(all_tuning_matrix, 1, paste0, collapse = \":\")\n  unique_vec <- unique(tuning_vec)\n  mat <- match(unique_vec, tuning_vec)\n\n  num_iter_vec <- num_iter_vec[mat]\n  beta_matrix <- beta_matrix[mat, ]\n  all_tuning_matrix <- all_tuning_matrix[mat, ]\n\n  # Reorders the rows by the number of non-zero coefficients\n  num_counts <- apply(beta_matrix, 1, Non_zero)\n  ord <- order(num_counts)\n\n  num_iter_vec <- num_iter_vec[ord]\n  beta_matrix <- beta_matrix[ord, ]\n  all_tuning_matrix <- all_tuning_matrix[ord, ]\n\n  output <- list(\n    beta_matrix = beta_matrix,\n    num_iter_vec = num_iter_vec,\n    all_tuning_matrix = all_tuning_matrix\n  )\n  return(output)\n}","normpath":"/home/jared/Desktop/PANPRS-next-Katya/PANPRSnext/R/Internal_functions.R"}],"prof_output":"/home/jared/Desktop/PANPRS-next-Katya/PANPRSnext/.Rproj.user/5BD58143/profiles-cache/file1a6a3b3849a0.Rprof","highlight":{"output":["^output\\$"],"gc":["^<GC>$"],"stacktrace":["^\\.\\.stacktraceo(n|ff)\\.\\.$"]},"split":"h"}},"evals":[],"jsHooks":[]}</script>
